import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

export interface AuthRequestDto{
  username: string;
  password: string;

}

export interface RecupTokenRoleDto{
  token: string;
  roles:  any;
}

@Injectable({
  providedIn: 'root'
})
export class AuthService {

  constructor(private http: HttpClient) { }




  send(authResponseDto: AuthRequestDto): Observable<RecupTokenRoleDto>{
    return this.http.post(`http://localhost:80/authorize`, authResponseDto ) as Observable<RecupTokenRoleDto
    >;    
  }

}
